  color: '#fa9191',
  textTransform: 'capitalize',
  fontWeight: 'bold'
}

ReactDOM.render(
  <>
    <h1 className="head" style={{
      color: '#fa9191',
      textTransform: 'capitalize',
      fontWeight: 'bold'
    }}>My name is {names}</h1>
    <img src="" alt="" />
  </>, document.getElementById('root')
);
